Natrlich treffen rzte die medizinischen Entscheidungen aber das war's mit der Weisungsbefugnis, es ist nicht (mehr) so dass die Pfleger den rzten unterstellt wren, sondern der Pflegeleitung. 
Personalmangel hat da wahrscheinlich zusammengeschweit vor 30 Jahren sah das ja noch ganz anderes aus und trotzdem war die Behandlung oft weniger erfolgreich, was vielleicht nicht nur am Stand der Medizin lag.

